
dna = ""
pattern = "CAAACGTGGT"
d = 5

positions = []

def check_pattern(substring, pattern, d):
    errors = 0
    for i in range(len(pattern)):
        if pattern[i] != substring[i]:
            errors = errors + 1
    if errors > d:
        return False
    return True

for i in range(len(dna)-len(pattern)):
    if check_pattern(dna[i:i+len(pattern)], pattern, d):
        positions.append(str(i))

print(" ".join(positions))
        
